import React, { Component } from 'react';

function Item(props) {
    return (
        <image className="item">
            {props.items}
        </image>
    );
}

class HeroItems extends Component {
    renderItem(i) {
        return (
            <Item
                value={this.props.items[i]}
            />
        );
    }

    render() {
        return (
            <div className="hero-items__container">
                <div>
                    <div className="items-row">
                        {this.renderItem(0)}
                        {this.renderItem(1)}
                        {this.renderItem(2)}
                    </div>
                    <div className="items-row">
                        {this.renderItem(3)}
                        {this.renderItem(4)}
                        {this.renderItem(5)}
                    </div>
                    <div className="items-row">
                        {this.renderItem(6)}
                        {this.renderItem(7)}
                        {this.renderItem(8)}
                    </div>
                    <div className="items-row">
                        {this.renderItem(9)}
                        {this.renderItem(10)}
                        {this.renderItem(11)}
                    </div>
                </div>
            </div>
        );
    }
}

export default HeroItems;
